import { React, useState } from "react";
import "../TinderCards.css";

function TinderCards() {
  const [people, setPeople] = useState([
    {
      name: "Aleksandar Sujic.jpg",
      url: "/images/me.",
    },
  ]);
  return <div className="TinderCards"></div>;
  {
    people.map((person) => {
      <h1>{person.name}</h1>;
    });
  }
}

export default TinderCards;
